import React,{Component} from "react";

class CallApi extends Component {
    state = { 
        data:[]
     } 

    componentDidMount(){
        fetch('http://127.0.0.1:5000/get_tambon/หนองจะบก')
            .then(res => res.json())
            .then(res => this.state({data:res}))
    }

    render() { 
        return (
            <div>
                {JSON.stringify(this.state.data)}
            </div>
        );
    }
}
 
export default CallApi;
